(function(window, modules){

  modules.define(
    'Protection',
    [
      'tools',
      'consts',
      'Sprite'
    ],
    function(
      provide,
      tools,
      consts,
      Sprite
    ){

      var Protection = tools.extend(Sprite),

        $class = Protection,
        $super = $class.superclass;

      _.mixin($class.prototype, {

        initialize : function(config) {
          $super.initialize.call(this, {
            sprite: 'data:image/png;base64,',
            steps: 1,
            speed: 50,
            delay: 250,
            loop: false,
            size: {
              width  : consts.PROTECTION_WIDTH,
              height : consts.PROTECTION_HEIGHT
            }
          });
        }

      });

      provide(Protection);
    });

}(this, this.modules));
